import React, { useEffect, useState } from 'react'

const Rent = () => {
  const[units, setUnits] = useState([])
  useEffect(() => {
     fetch("/storage_units")
       .then((r) => r.json())
       .then((data) => setUnits(data));
  }, [])

  return (
    <div>
      <h1>All Available units</h1>
      {units.filter(unit => unit.stat)}
    </div>
  );
}

export default Rent
